[['def consecutive_unique_char(A):
	my_string = A
	unique_char = ""
	for i in range(len(my_string)):
		if my_string[i] not in unique_char:
			unique_char += my_string[i]
	result_substring = ""
	for i in range(len(unique_char)):
		for j in range(i+1, len(unique_char)):
			if unique_char[i] == unique_char[j]:
				result_substring += unique_char[i]
']]

[['def longest_palindrome(A):
	my_string = A
	longest_palindrome = ""
	for i in range(len(my_string)):
		for j in range(len(my_string)):
			if i == j:
				continue
			else:
				if my_string[i] == my_string[j]:
					longest_palindrome = my_string[i:j+1]
	palindrome_list = []
	for i in range(len(longest_palindrome)):
		for j in range(len(longest_palindrome)):
			if i == j:
				continue
			else:
				if longest_palindrome[i] == longest_palindrome[j]:
					palindrome_list.append(longest_palindrome[i:j+1])
']]

