[['def rotate_array(A,K):
	my_array = A
	n = len(A)
	for i in range(n):
		for j in range(n):
			if i == j:
				continue
			else:
				temp = my_array[i]
				my_array[i] = my_array[j]
				my_array[j] = temp
	k = K
	for i in range(n):
		if my_array[i] == 0:
			my_array[i] = 1
			k -= 1
	rotated_result = [0] * n
	for i in range(n):
		rotated_result[i] = my_array[i]
